import React, { useState } from "react";
import '../styles/Header.css';
import cartIcon from '../images/cart-icon-2.png';
import { Link } from "react-router-dom";

function Header() {

  const [itemsInCart, setItemsInCart] = useState(0);

  return (
    <div className="header">
      <div className="header-title-section">
        <div className="header-title">BRAND</div>
        <div className="header-links">
          <div className="header-link"><Link to={'/'}>Home</Link></div>
          <div className="header-link">Men</div>
          <div className="header-link">Women</div>
          <div className="header-link"><Link to={'/about'}>About</Link></div>
        </div>
      </div>
      <div className="cart"><img src={cartIcon} alt='cart-icon'/></div>
      <div className="items-in-cart">{itemsInCart}</div>
    </div>
  )
}

export default Header;
